import { useState, useEffect, useRef, memo, Dispatch, SetStateAction } from "react"

const MapWithTooltip = ({ fill, ...props }) => {
  const [isInfoVisible, setIsInfoVisible] = useState(false)
  const [infoPosition, setInfoPosition] = useState({ x: 0, y: 0 })
  const [targetId, setTargetId] = useState<string | null>(null)
  return (
    <div>
      <Tooltip isVisible={isInfoVisible} position={infoPosition} id={targetId} />
      <DistrictMap
        fill={fill}
        setIsVisible={setIsInfoVisible}
        setPosition={setInfoPosition}
        setId={setTargetId}
        {...props}
      ></DistrictMap>
    </div>
  )
}

const Tooltip = ({ isVisible, position, id, ...props }) => {
  useEffect(() => {
    console.log({ id })
  }, [isVisible, position, id])

  return id ? (
    <div
      tw="absolute p-2 font-semibold text-white bg-gray-800 rounded pointer-events-none bg-opacity-80"
      style={{ display: isVisible ? "block" : "none", left: position.x + 10, top: position.y + 10 }}
    >
      {id}
    </div>
  ) : null
}

